class Solution {
    /**
    Find how many times a given substring can be found in the original string. Count overlapping cases.
    >>> how_many_times("", "a")
    0
    >>> how_many_times("aaa", "a")
    3
    >>> how_many_times("aaaa", "aa")
    3
     */
    public int how_many_times(String string, String substring) {
        int count = 0;
        int start = 0;
        while (true) {
            start = string.indexOf(substring, start);
            if (start == -1) {
                break;
            }
            count++;
            start++; // Move to the next character to allow for overlapping matches
        }
        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.how_many_times("", "a")); // Output: 0
        System.out.println(solution.how_many_times("aaa", "a")); // Output: 3
        System.out.println(solution.how_many_times("aaaa", "aa")); // Output: 3
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.how_many_times("", "x") == 0,
                s.how_many_times("xyxyxyx", "x") == 4,
                s.how_many_times("cacacacac", "cac") == 4,
                s.how_many_times("john doe", "john") == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

