class Solution {
    /**
    Create a function that returns true if the last character
    of a given string is an alphabetical character and is not
    a part of a word, and false otherwise.
    Note: "word" is a group of characters separated by space.

    Examples:
    check_if_last_char_is_a_letter("apple pie") -> false
    check_if_last_char_is_a_letter("apple pi e") -> true
    check_if_last_char_is_a_letter("apple pi e ") -> false
    check_if_last_char_is_a_letter("") -> false
     */
    public boolean check_if_last_char_is_a_letter(String txt) {
        if (txt == null || txt.isEmpty()) {
            return false;
        }

        // Strip any trailing whitespace
        txt = txt.stripTrailing();

        // Check if the last character is an alphabetical character
        char lastChar = txt.charAt(txt.length() - 1);
        if (!Character.isLetter(lastChar)) {
            return false;
        }

        // Check if the last character is not part of a word
        if (txt.length() == 1 || txt.charAt(txt.length() - 2) == ' ') {
            return true;
        }

        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.check_if_last_char_is_a_letter("apple" ) == false,
                s.check_if_last_char_is_a_letter("apple pi e" ) == true,
                s.check_if_last_char_is_a_letter("eeeee" ) == false,
                s.check_if_last_char_is_a_letter("A" ) == true,
                s.check_if_last_char_is_a_letter("Pumpkin pie " ) == false,
                s.check_if_last_char_is_a_letter("Pumpkin pie 1" ) == false,
                s.check_if_last_char_is_a_letter("" ) == false,
                s.check_if_last_char_is_a_letter("eeeee e " ) == false,
                s.check_if_last_char_is_a_letter("apple pie" ) == false,
                s.check_if_last_char_is_a_letter("apple pi e " ) == false
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

import java.math.BigInteger;
