class Solution {
    /**
    Your task is to write a function that returns true if a number x is a simple
    power of n and false in other cases.
    x is a simple power of n if n**int=x
    For example:
    is_simple_power(1, 4) => true
    is_simple_power(2, 2) => true
    is_simple_power(8, 2) => true
    is_simple_power(3, 2) => false
    is_simple_power(3, 1) => false
    is_simple_power(5, 3) => false
     */
    public boolean is_simple_power(int x, int n) {
        if (n == 1) {
            return x == 1;
        }
        if (n <= 0 || x <= 0) {
            return false;
        }
        int power = 1;
        while (power < x) {
            power *= n;
        }
        return power == x;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_simple_power(1, 4),
                s.is_simple_power(2, 2),
                s.is_simple_power(8, 2),
                !s.is_simple_power(3, 2),
                !s.is_simple_power(3, 1),
                !s.is_simple_power(5, 3),
                s.is_simple_power(16, 2),
                !s.is_simple_power(143214, 16),
                s.is_simple_power(4, 2),
                s.is_simple_power(9, 3),
                s.is_simple_power(16, 4),
                !s.is_simple_power(24, 2),
                !s.is_simple_power(128, 4),
                !s.is_simple_power(12, 6),
                s.is_simple_power(1, 1),
                s.is_simple_power(1, 12)
        );
