class Solution {
    /**
    Given a list of numbers, return whether or not they are sorted
    in ascending order. If the a number appears more than twice, return false. Assume no negative numbers and only integers.

    Examples
    is_sorted(Arrays.asList(5)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5)) -> false
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6, 7)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5, 6, 7)) -> false
    is_sorted(Arrays.asList(1, 2, 2, 3, 3, 4)) -> true
    is_sorted(Arrays.asList(1, 2, 2, 2, 3, 4)) -> false
     */
    public boolean is_sorted(List<Integer> lst) {
        if (lst.size() <= 1) {
            return true;
        }

        int prev = lst.get(0);
        Map<Integer, Integer> countMap = new HashMap<>();

        for (int num : lst) {
            if (countMap.containsKey(num)) {
                countMap.put(num, countMap.get(num) + 1);
                if (countMap.get(num) > 2) {
                    return false;
                }
            } else {
                countMap.put(num, 1);
            }

            if (num < prev) {
                return false;
            }
            prev = num;
        }

        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_sorted(new ArrayList<>(List.of(5))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 3, 2, 4, 5))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 6))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, 6, 7))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 3, 2, 4, 5, 6, 7))) == false,
                s.is_sorted(new ArrayList<>(List.of())) == true,
                s.is_sorted(new ArrayList<>(List.of(1))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(3, 2, 1))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 2, 2, 3, 4))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 3, 3, 4))) == false,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 2, 3, 3, 4))) == true,
                s.is_sorted(new ArrayList<>(Arrays.asList(1, 2, 3, 4))) == true
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

