class Solution {
    /**
    Return the largest prime factor of n. Assume n > 1 and is not a prime.
    >>> largest_prime_factor(13195)
    29
    >>> largest_prime_factor(2048)
    2
     */
    public int largest_prime_factor(int n) {
        int factor = 2;
        int lastFactor = 1;

        while (n > 1) {
            if (n % factor == 0) {
                lastFactor = factor;
                n /= factor;
                while (n % factor == 0) {
                    n /= factor;
                }
            }
            factor++;
        }

        return lastFactor;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.largest_prime_factor(13195)); // Output: 29
        System.out.println(solution.largest_prime_factor(2048));  // Output: 2
    }
}

