    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.largest_prime_factor(15) == 5,
                s.largest_prime_factor(27) == 3,
                s.largest_prime_factor(63) == 7,
                s.largest_prime_factor(330) == 11,
                s.largest_prime_factor(13195) == 29
        );
