class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int N = grid.size();
        int[][] directions = {{0, 1}, {1, 0}, {-1, 0}, {0, -1}};

        // Priority queue to store (current path, current position)
        PriorityQueue<PathInfo> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < Math.min(a.path.size(), b.path.size()); i++) {
                if (!a.path.get(i).equals(b.path.get(i))) {
                    return a.path.get(i) - b.path.get(i);
                }
            }
            return a.path.size() - b.path.size();
        });

        // Initial population of the priority queue
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                List<Integer> initialPath = new ArrayList<>();
                initialPath.add(grid.get(i).get(j));
                pq.offer(new PathInfo(i, j, initialPath));
            }
        }

        // Main loop
        while (!pq.isEmpty()) {
            PathInfo current = pq.poll();
            int x = current.x;
            int y = current.y;
            List<Integer> path = current.path;

            if (path.size() == k) {
                return path;
            }

            for (int[] dir : directions) {
                int nx = x + dir[0];
                int ny = y + dir[1];
                if (0 <= nx && nx < N && 0 <= ny && ny < N) {
                    List<Integer> new_path = new ArrayList<>(path);
                    new_path.add(grid.get(nx).get(ny));
                    pq.offer(new PathInfo(nx, ny, new_path));
                }
            }
        }

        return new ArrayList<>(); // Should not reach here
    }

    // Helper class to store path information
    private static class PathInfo {
        int x;
        int y;
        List<Integer> path;

        PathInfo(int x, int y, List<Integer> path) {
            this.x = x;
            this.y = y;
            this.path = path;
        }
    }
}

