class Solution {
    /**
    Given a positive integer N, return in binary the total sum of its digits.

    Example
        For N = 1000, the sum of digits will be 1 the output should be "1".
        For N = 150, the sum of digits will be 6 the output should be "110".
        For N = 147, the sum of digits will be 12 the output should be "1100".

    Variables:
        @N integer
             Constraints: 0 <= N <= 10000.
    Output:
         a string of binary number
     */
    public String solve(int N) {
        // Calculate the sum of the digits of N
        int digitSum = 0;
        while (N > 0) {
            digitSum += N % 10;
            N /= 10;
        }

        // Convert the sum to binary and return it as a string
        return Integer.toBinaryString(digitSum);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.solve(1000)); // Output: "1"
        System.out.println(solution.solve(150));  // Output: "110"
        System.out.println(solution.solve(147));  // Output: "1100"
    }
}

