class Solution {
    /**
    You are given a string representing a sentence,
    the sentence contains some words separated by a space,
    and you have to return a string that contains the words from the original sentence,
    whose lengths are prime numbers,
    the order of the words in the new string should be the same as the original one.

    Example 1:
        Input: sentence = "This is a test"
        Output: "is"

    Example 2:
        Input: sentence = "lets go for swimming"
        Output: "go for"

    Constraints:
        * 1 <= len(sentence) <= 100
        * sentence contains only letters
     */

    public String words_in_sentence(String sentence) {
        // Split the sentence into words
        String[] words = sentence.split(" ");

        // StringBuilder to construct the result string
        StringBuilder result = new StringBuilder();

        // Iterate through the words and check if their lengths are prime
        for (String word : words) {
            if (isPrime(word.length())) {
                result.append(word).append(" ");
            }
        }

        // Remove the trailing space if present
        if (result.length() > 0) {
            result.setLength(result.length() - 1);
        }

        return result.toString();
    }

    // Helper method to check if a number is prime
    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n <= 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        for (int i = 5; i * i <= n; i += 6) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.words_in_sentence("This is a test" ), "is" ),
                Objects.equals(s.words_in_sentence("lets go for swimming" ), "go for" ),
                Objects.equals(s.words_in_sentence("there is no place available here" ), "there is no place" ),
                Objects.equals(s.words_in_sentence("Hi I am Hussein" ), "Hi am Hussein" ),
                Objects.equals(s.words_in_sentence("go for it" ), "go for it" ),
                Objects.equals(s.words_in_sentence("here" ), "" ),
                Objects.equals(s.words_in_sentence("here is" ), "is" )
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

