class Solution {
    public int max_fill(List<List<Integer>> grid, int capacity) {
        int totalBucketLowerings = 0;

        // Iterate over each well (row) in the grid
        for (List<Integer> row : grid) {
            int waterInWell = 0;

            // Calculate the total amount of water in the current well
            for (int waterUnit : row) {
                waterInWell += waterUnit;
            }

            // Calculate the number of times the bucket needs to be lowered for this well
            int bucketLoweringsForWell = waterInWell / capacity;
            if (waterInWell % capacity != 0) {
                bucketLoweringsForWell++;
            }

            // Add to the total number of bucket lowerings
            totalBucketLowerings += bucketLoweringsForWell;
        }

        return totalBucketLowerings;
    }
}

