class Solution {
    /**
    Input is a space-delimited string of numberals from 'zero' to 'nine'.
    Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    Return the string with numbers sorted from smallest to largest
    >>> sort_numbers("three one five")
    "one three five"
     */
    public String sort_numbers(String numbers) {
        // Mapping of number words to their numeric values
        Map<String, Integer> numMap = new HashMap<>();
        numMap.put("zero", 0);
        numMap.put("one", 1);
        numMap.put("two", 2);
        numMap.put("three", 3);
        numMap.put("four", 4);
        numMap.put("five", 5);
        numMap.put("six", 6);
        numMap.put("seven", 7);
        numMap.put("eight", 8);
        numMap.put("nine", 9);

        // Split the input string into a list of words
        String[] words = numbers.split(" ");

        // Convert the words to their numeric values
        List<Integer> nums = new ArrayList<>();
        for (String word : words) {
            nums.add(numMap.get(word));
        }

        // Sort the numeric values
        Collections.sort(nums);

        // Convert the sorted numeric values back to words
        List<String> sortedWords = new ArrayList<>();
        for (int num : nums) {
            for (Map.Entry<String, Integer> entry : numMap.entrySet()) {
                if (entry.getValue().equals(num)) {
                    sortedWords.add(entry.getKey());
                    break;
                }
            }
        }

        // Join the sorted words back into a single string
        return String.join(" ", sortedWords);
    }
}

