class Solution {
    /**
    Given two positive integers a and b, return the even digits between a
    and b, in ascending order. Please note that the even digits refer to even numbers less than 10.

    For example:
    generate_integers(2, 8) => [2, 4, 6, 8]
    generate_integers(8, 2) => [2, 4, 6, 8]
    generate_integers(10, 14) => []
     */
    public List<Integer> generate_integers(int a, int b) {
        // Ensure a is always less than or equal to b
        if (a > b) {
            int temp = a;
            a = b;
            b = temp;
        }

        // Define the even digits
        List<Integer> evenDigits = new ArrayList<>(List.of(2, 4, 6, 8));

        // Filter the even digits that fall within the range [a, b]
        List<Integer> result = new ArrayList<>();
        for (int digit : evenDigits) {
            if (a <= digit && digit <= b) {
                result.add(digit);
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.generate_integers(2, 8)); // [2, 4, 6, 8]
        System.out.println(solution.generate_integers(8, 2)); // [2, 4, 6, 8]
        System.out.println(solution.generate_integers(10, 14)); // []
    }
}

