class Solution {
    /**
    You are given a word. Your task is to find the closest vowel that stands between
    two consonants from the right side of the word (case sensitive).

    Vowels in the beginning and ending doesn't count. Return empty string if you didn't
    find any vowel met the above condition.

    You may assume that the given string contains English letter only.

    Example:
    get_closest_vowel("yogurt") ==> "u"
    get_closest_vowel("FULL") ==> "U"
    get_closest_vowel("quick") ==> ""
    get_closest_vowel("ab") ==> ""
     */
    public String get_closest_vowel(String word) {
        // Define the vowels
        String vowels = "aeiouAEIOU";
        // Initialize the closest vowel
        String closestVowel = "";

        // Iterate from the end of the word to the beginning
        for (int i = word.length() - 2; i > 0; i--) {
            char currentChar = word.charAt(i);
            char prevChar = word.charAt(i - 1);
            char nextChar = word.charAt(i + 1);

            // Check if the current character is a vowel and the previous and next characters are consonants
            if (vowels.indexOf(currentChar) != -1 && vowels.indexOf(prevChar) == -1 && vowels.indexOf(nextChar) == -1) {
                closestVowel = String.valueOf(currentChar);
                break;
            }
        }

        return closestVowel;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.get_closest_vowel("yogurt")); // "u"
        System.out.println(solution.get_closest_vowel("FULL"));   // "U"
        System.out.println(solution.get_closest_vowel("quick"));  // ""
        System.out.println(solution.get_closest_vowel("ab"));     // ""
    }
}

