class Solution {
    /**
    Write a function that accepts a list of strings.
    The list contains different words. Return the word with maximum number
    of unique characters. If multiple strings have maximum number of unique
    characters, return the one which comes first in lexicographical order.

    find_max(["name", "of", "string"]) == "string"
    find_max(["name", "enam", "game"]) == "enam"
    find_max(["aaaaaaa", "bb" ,"cc"]) == "aaaaaaa"
     */
    public String find_max(List<String> words) {
        // Helper method to count unique characters in a word
        int maxUnique = 0;
        String maxWord = "";

        for (String word : words) {
            int numUnique = uniqueChars(word);
            if (numUnique > maxUnique || (numUnique == maxUnique && word.compareTo(maxWord) < 0)) {
                maxUnique = numUnique;
                maxWord = word;
            }
        }

        return maxWord;
    }

    // Helper method to count unique characters in a word
    private int uniqueChars(String word) {
        Set<Character> charSet = new HashSet<>();
        for (char c : word.toCharArray()) {
            charSet.add(c);
        }
        return charSet.size();
    }
}

