    double_the_difference(Arrays.asList(-1, -2, 0)) == 0
    double_the_difference(Arrays.asList(9, -2)) == 81
    double_the_difference(Arrays.asList(0)) == 0

    If the input list is empty, return 0.
     */
    public int double_the_difference(List<Object> lst) {
        int sum = 0;
        for (Object obj : lst) {
            if (obj instanceof Integer) {
                int num = (Integer) obj;
                if (num > 0 && num % 2 != 0) {
                    sum += num * num;
                }
            }
        }
        return sum;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.double_the_difference(Arrays.asList(1, 3, 2, 0))); // Output: 10
        System.out.println(solution.double_the_difference(Arrays.asList(-1, -2, 0))); // Output: 0
        System.out.println(solution.double_the_difference(Arrays.asList(9, -2))); // Output: 81
        System.out.println(solution.double_the_difference(Arrays.asList(0))); // Output: 0
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.double_the_difference(List.of()) == 0,
                s.double_the_difference(Arrays.asList(5, 4)) == 25,
                s.double_the_difference(Arrays.asList(0.1, 0.2, 0.3)) == 0,
                s.double_the_difference(Arrays.asList(-10, -20, -30)) == 0,
