class Solution {
    /**
    Write a function count_nums which takes an array of integers and returns
    the number of elements which has a sum of digits > 0.
    If a number is negative, then its first signed digit will be negative:
    e.g. -123 has signed digits -1, 2, and 3.
    >>> count_nums(Arrays.asList()) == 0
    >>> count_nums(Arrays.asList(-1, 11, -11)) == 1
    >>> count_nums(Arrays.asList(1, 1, 2)) == 3
     */
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            if (sumOfDigits(num) > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumOfDigits(int n) {
        int sum = 0;
        boolean isNegative = n < 0;
        String numStr = Integer.toString(n);

        for (int i = 0; i < numStr.length(); i++) {
            char c = numStr.charAt(i);
            if (c == '-') {
                continue;
            }
            int digit = Character.getNumericValue(c);
            if (isNegative && i == 1) {
                digit = -digit;
            }
            sum += digit;
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.count_nums(List.of()) == 0,
                s.count_nums(Arrays.asList(-1, -2, 0)) == 0,
                s.count_nums(Arrays.asList(1, 1, 2, -2, 3, 4, 5)) == 6,
                s.count_nums(Arrays.asList(1, 6, 9, -6, 0, 1, 5)) == 5,
                s.count_nums(Arrays.asList(1, 100, 98, -7, 1, -1)) == 4,
                s.count_nums(Arrays.asList(12, 23, 34, -45, -56, 0)) == 5,
                s.count_nums(Arrays.asList(-0, (int) Math.pow(1, 0))) == 1,
                s.count_nums(List.of(1)) == 1
        );
