class Solution {
    /**
    You are given a list of integers.
    Write a function next_smallest() that returns the 2nd smallest element of the list.
    Return null if there is no such element.
    <p>
    next_smallest(Arrays.asList(1, 2, 3, 4, 5)) == Optional[2]
    next_smallest(Arrays.asList(5, 1, 4, 3, 2)) == Optional[2]
    next_smallest(Arrays.asList()) == Optional.empty
    next_smallest(Arrays.asList(1, 1)) == Optional.empty
     */
    public Optional<Integer> next_smallest(List<Integer> lst) {
        // Check if the list has fewer than 2 elements
        if (lst.size() < 2) {
            return Optional.empty();
        }

        // Remove duplicates by converting the list to a set
        Set<Integer> uniqueSet = new HashSet<>(lst);

        // Check if the set has fewer than 2 unique elements
        if (uniqueSet.size() < 2) {
            return Optional.empty();
        }

        // Convert the set back to a list and sort it
        List<Integer> uniqueList = new ArrayList<>(uniqueSet);
        Collections.sort(uniqueList);

        // Return the second smallest element
        return Optional.of(uniqueList.get(1));
    }
}

