class Solution {
    /**
    For a given list of integers, return a tuple consisting of a sum and a product of all the integers in a list.
    Empty sum should be equal to 0 and empty product should be equal to 1.
    >>> sum_product(List.of())
    [0, 1]
    >>> sum_product(Arrays.asList(1, 2, 3, 4))
    [10, 24]
     */
    public List<Integer> sum_product(List<Integer> numbers) {
        // Check if the list is empty
        if (numbers.isEmpty()) {
            return Arrays.asList(0, 1);
        }

        // Initialize sum and product
        int totalSum = 0;
        int totalProduct = 1;

        // Iterate through the list to calculate sum and product
        for (int num : numbers) {
            totalSum += num;
            totalProduct *= num;
        }

        // Return the result as a list
        return Arrays.asList(totalSum, totalProduct);
    }
}

