class Solution {
    /**
    Given an array of non-negative integers, return a copy of the given array after sorting,
    you will sort the given array in ascending order if the sum( first index value, last index value) is odd,
    or sort it in descending order if the sum( first index value, last index value) is even.

    Note:
    * don't change the given array.

    Examples:
    * sort_array(Arrays.asList()) => []
    * sort_array(Arrays.asList(5)) => [5]
    * sort_array(Arrays.asList(2, 4, 3, 0, 1, 5)) => [0, 1, 2, 3, 4, 5]
    * sort_array(Arrays.asList(2, 4, 3, 0, 1, 5, 6)) => [6, 5, 4, 3, 2, 1, 0]
     */
    public List<Integer> sort_array(List<Integer> array) {
        if (array.isEmpty()) {
            return new ArrayList<>();
        }

        // Calculate the sum of the first and last elements
        int sumFirstLast = array.get(0) + array.get(array.size() - 1);

        // Create a copy of the array to avoid modifying the original array
        List<Integer> sortedArray = new ArrayList<>(array);

        // Determine the sorting order based on the sum
        if (sumFirstLast % 2 == 0) {
            // Sort in descending order
            sortedArray.sort(Comparator.reverseOrder());
        } else {
            // Sort in ascending order
            sortedArray.sort(Comparator.naturalOrder());
        }

        return sortedArray;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_array(new ArrayList<>(List.of())).equals(List.of()),
