class Solution {
    /**
    Test if given string is a palindrome
     */
    public boolean isPalindrome(String string) {
        int i = 0;
        int j = string.length() - 1;
        while (i < j) {
            if (string.charAt(i) != string.charAt(j)) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }

    /**
    Find the shortest palindrome that begins with a supplied string.
    Algorithm idea is simple:
    - Find the longest postfix of supplied string that is a palindrome.
    - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    >>> make_palindrome("")
    ""
    >>> make_palindrome("cat")
    "catac"
    >>> make_palindrome("cata")
    "catac"
     */
    public String make_palindrome(String string) {
        if (string.isEmpty()) {
            return "";
        }

        // Find the longest palindromic suffix
        int i = 0;
        for (; i < string.length(); i++) {
            if (isPalindrome(string.substring(i))) {
                break;
            }
        }

        // The non-palindromic prefix
        String prefix = string.substring(0, i);

        // The reversed prefix to append
        String reversedPrefix = new StringBuilder(prefix).reverse().toString();

        return string + reversedPrefix;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.make_palindrome("")); // Output: ""
        System.out.println(solution.make_palindrome("cat")); // Output: "catac"
        System.out.println(solution.make_palindrome("cata")); // Output: "catac"
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.make_palindrome(""), ""),
                Objects.equals(s.make_palindrome("x"), "x"),
                Objects.equals(s.make_palindrome("xyz"), "xyzyx"),
                Objects.equals(s.make_palindrome("xyx"), "xyx"),
                Objects.equals(s.make_palindrome("jerry"), "jerryrrej")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

