class Solution {
    /**
    You are given a string s.
    Your task is to check if the string is happy or not.
    A string is happy if its length is at least 3 and every 3 consecutive letters are distinct
    For example:
    is_happy(a) => false
    is_happy(aa) => false
    is_happy(abcd) => true
    is_happy(aabb) => false
    is_happy(adb) => true
    is_happy(xyy) => false
     */
    public boolean is_happy(String s) {
        // Check if the length of the string is less than 3
        if (s.length() < 3) {
            return false;
        }

        // Iterate through the string to check every 3 consecutive letters
        for (int i = 0; i < s.length() - 2; i++) {
            // Check if any of the 3 consecutive letters are the same
            if (s.charAt(i) == s.charAt(i + 1) || s.charAt(i + 1) == s.charAt(i + 2) || s.charAt(i) == s.charAt(i + 2)) {
                return false;
            }
        }

        // If no 3 consecutive letters are the same, the string is happy
        return true;
    }
}

