class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1;
        }
        // For n-digit numbers, there are 9^(n-1) numbers that start with 1
        // and 9^(n-1) numbers that end with 1.
        // However, we need to subtract the overlap (numbers that start and end with 1),
        // which is 9^(n-2) for n > 1.
        int countStartWith1 = (int) Math.pow(9, n - 1);
        int countEndWith1 = (int) Math.pow(9, n - 1);
        int countBothStartAndEndWith1 = (int) Math.pow(9, n - 2);

        return countStartWith1 + countEndWith1 - countBothStartAndEndWith1;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.starts_one_ends(1)); // Output: 1
        System.out.println(solution.starts_one_ends(2)); // Output: 17
        System.out.println(solution.starts_one_ends(3)); // Output: 162
    }
}

