class Solution {
    /**
    Evaluates polynomial with coefficients xs at point x.
    return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
     */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
    xs are coefficients of a polynomial.
    find_zero find x such that poly(x) = 0.
    find_zero returns only one zero point, even if there are many.
    Moreover, find_zero only takes list xs having even number of coefficients
    and largest non zero coefficient as it guarantees
    a solution.
    >>> find_zero(Arrays.asList(1, 2)) // f(x) = 1 + 2x
    -0.5
    >>> find_zero(Arrays.asList(-6, 11, -6, 1)) // (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3
    1.0
     */
    public double find_zero(List<Double> xs) {
        // Using the bisection method to find a root
        double a = -1000, b = 1000;  // Initial interval
        double fa = poly(xs, a);
        double fb = poly(xs, b);

        // Ensure the signs of fa and fb are different
        while (fa * fb > 0) {
            a -= 1000;
            b += 1000;
            fa = poly(xs, a);
            fb = poly(xs, b);
        }

        // Bisection method
        double tolerance = 1e-7;
        while ((b - a) / 2.0 > tolerance) {
            double midpoint = (a + b) / 2.0;
            double fmid = poly(xs, midpoint);
            if (fmid == 0) {
                return midpoint;
            } else if (fa * fmid < 0) {
                b = midpoint;
                fb = fmid;
            } else {
                a = midpoint;
                fa = fmid;
            }
        }

        return (a + b) / 2.0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Double> coefficients1 = Arrays.asList(1.0, 2.0);
        List<Double> coefficients2 = Arrays.asList(-6.0, 11.0, -6.0, 1.0);

        System.out.println(solution.find_zero(coefficients1)); // Expected output: -0.5
        System.out.println(solution.find_zero(coefficients2)); // Expected output: 1.0
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

