class Solution {
    /**
    Write a function that returns true if the given number is the multiplication of 3 prime numbers
    and false otherwise.
    Knowing that the prime number is less then 100.
    Example:
    is_multiply_prime(30) == true
    30 = 2 * 3 * 5
     */
    public boolean is_multiply_prime(int a) {
        List<Integer> primeFactors = new ArrayList<>();

        for (int i = 2; i < 100; i++) {
            if (isPrime(i) && a % i == 0) {
                primeFactors.add(i);
                a /= i;
                if (primeFactors.size() > 3) {
                    return false;
                }
            }
        }

        return primeFactors.size() == 3 && a == 1;
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(n); i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

