class Solution {
    /**
    You are given a list of two strings, both strings consist of open
    parentheses "(" or close parentheses ")" only.
    Your job is to check if it is possible to concatenate the two strings in
    some order, that the resulting string will be good.
    A string S is considered to be good if and only if all parentheses in S
    are balanced. For example: the string "(())()" is good, while the string
    "())" is not.
    Return "Yes" if there's a way to make a good string, and return "No" otherwise.

    Examples:
    match_parens(Arrays.asList("()(", ")")) == "Yes"
    match_parens(Arrays.asList(")", ")")) == "No"
     */
    public String match_parens(List<String> lst) {
        // Unpack the list into two strings
        String s1 = lst.get(0);
        String s2 = lst.get(1);

        // Check if either concatenation is balanced
        if (isBalanced(s1 + s2) || isBalanced(s2 + s1)) {
            return "Yes";
        } else {
            return "No";
        }
    }

    // Helper function to check if a string is balanced
    private boolean isBalanced(String s) {
        int balance = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
            if (balance < 0) {
                return false;
            }
        }
        return balance == 0;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.match_parens(Arrays.asList("()(", ")"))); // Output: Yes
        System.out.println(solution.match_parens(Arrays.asList(")", ")"))); // Output: No
    }
}

