class Solution {
    /**
    Create a function encrypt that takes a string as an argument and
    returns a string encrypted with the alphabet being rotated.
    The alphabet should be rotated in a manner such that the letters
    shift down by two multiplied to two places.
    For example:
    encrypt("hi") returns "lm"
    encrypt("asdfghjkl") returns "ewhjklnop"
    encrypt("gf") returns "kj"
    encrypt("et") returns "ix"
     */
    public String encrypt(String s) {
        // Define the alphabet and the rotation factor
        String alphabet = "abcdefghijklmnopqrstuvwxyz";
        int rotationFactor = 2 * 2; // Rotate by 4 places

        // Initialize the result StringBuilder
        StringBuilder result = new StringBuilder();

        // Iterate over each character in the input string
        for (char c : s.toCharArray()) {
            if (alphabet.indexOf(c) != -1) {
                // Find the index of the character in the alphabet
                int index = alphabet.indexOf(c);
                // Calculate the new index after rotation
                int newIndex = (index + rotationFactor) % 26;
                // Append the rotated character to the result
                result.append(alphabet.charAt(newIndex));
            } else {
                // If the character is not in the alphabet, append it as is
                result.append(c);
            }
        }

        // Convert the StringBuilder to a string and return it
        return result.toString();
    }

    // Main method for testing
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.encrypt("hi")); // Output: lm
        System.out.println(solution.encrypt("asdfghjkl")); // Output: ewhjklnop
        System.out.println(solution.encrypt("gf")); // Output: kj
        System.out.println(solution.encrypt("et")); // Output: ix
    }
}

