class Solution {
    /**
    Given a list of positive integers x. return a sorted list of all
    elements that hasn't any even digit.

    Note: Returned list should be sorted in increasing order.

    For example:
    >>> unique_digits(Arrays.asList(15, 33, 1422, 1))
    [1, 15, 33]
    >>> unique_digits(Arrays.asList(152, 323, 1422, 10))
    []
     */

    // Helper method to check if a number has any even digit
    private boolean hasEvenDigit(int n) {
        while (n > 0) {
            int digit = n % 10;
            if (digit % 2 == 0) {
                return true;
            }
            n /= 10;
        }
        return false;
    }

    public List<Integer> unique_digits(List<Integer> x) {
        // Filter out numbers with even digits and sort the result
        List<Integer> result = new ArrayList<>();
        for (int num : x) {
            if (!hasEvenDigit(num)) {
                result.add(num);
            }
        }
        Collections.sort(result);
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> test1 = Arrays.asList(15, 33, 1422, 1);
        List<Integer> test2 = Arrays.asList(152, 323, 1422, 10);

        System.out.println(solution.unique_digits(test1)); // Output: [1, 15, 33]
        System.out.println(solution.unique_digits(test2)); // Output: []
    }
}

