        - the next odd number if n is odd.
        - the next even number if n is even.
    Return the number of stones in each level in a list, where element at index
    i represents the number of stones in the level (i+1).

    Examples:
    >>> make_a_pile(3)
    [3, 5, 7]
     */
    public List<Integer> make_a_pile(int n) {
        List<Integer> stones = new ArrayList<>();
        int currentStones = n;

        for (int i = 0; i < n; i++) {
            stones.add(currentStones);
            if (currentStones % 2 == 0) {
                currentStones += 2;  // Next even number
            } else {
                currentStones += 2;  // Next odd number
            }
        }

        return stones;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> result = solution.make_a_pile(3);
        System.out.println(result);  // Output: [3, 5, 7]
    }
}

