class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        if (arr.isEmpty()) {
            return new ArrayList<>();
        }

        int minEvenValue = Integer.MAX_VALUE;
        int minIndex = -1;

        for (int i = 0; i < arr.size(); i++) {
            int value = arr.get(i);
            if (value % 2 == 0 && value < minEvenValue) {
                minEvenValue = value;
                minIndex = i;
            }
        }

        if (minEvenValue == Integer.MAX_VALUE) {
            return new ArrayList<>();
        }

        return new ArrayList<>(List.of(minEvenValue, minIndex));
    }
}

