class Solution {
    /**
    Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor("010", "110")
    "100"
     */
    public String string_xor(String a, String b) {
        // Convert the binary strings to integers
        int intA = Integer.parseInt(a, 2);
        int intB = Integer.parseInt(b, 2);

        // Perform XOR operation
        int xorResult = intA ^ intB;

        // Convert the result back to a binary string
        String result = Integer.toBinaryString(xorResult);

        // Ensure the result has the same length as the input strings
        while (result.length() < a.length()) {
