class Solution {
    /**
    prime_fib returns n-th number that is a Fibonacci number and it's also prime.
    >>> prime_fib(1)
    2
    >>> prime_fib(2)
    3
    >>> prime_fib(3)
    5
    >>> prime_fib(4)
    13
    >>> prime_fib(5)
    89
     */
    public int prime_fib(int n) {
        int count = 0;
        int num = 1;
        while (true) {
            long fibNum = fib(num);
            if (isPrime(fibNum)) {
                count++;
                if (count == n) {
                    return (int) fibNum;
                }
            }
            num++;
        }
    }

    // Helper method to generate the m-th Fibonacci number
    private long fib(int m) {
        long a = 0, b = 1;
        for (int i = 0; i < m; i++) {
            long temp = a;
            a = b;
            b = temp + b;
        }
        return a;
    }

    // Helper method to check if a number is prime
    private boolean isPrime(long num) {
        if (num <= 1) {
            return false;
        }
        if (num <= 3) {
            return true;
        }
        if (num % 2 == 0 || num % 3 == 0) {
            return false;
        }
        for (long i = 5; i * i <= num; i += 6) {
            if (num % i == 0 || num % (i + 2) == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.prime_fib(1)); // 2
        System.out.println(solution.prime_fib(2)); // 3
        System.out.println(solution.prime_fib(3)); // 5
        System.out.println(solution.prime_fib(4)); // 13
        System.out.println(solution.prime_fib(5)); // 89
    }
}

