class Solution {
    /**
    Return true if a given number is prime, and false otherwise.
    >>> is_prime(6)
    false
    >>> is_prime(101)
    true
    >>> is_prime(11)
    true
    >>> is_prime(13441)
    true
    >>> is_prime(61)
    true
    >>> is_prime(4)
    false
    >>> is_prime(1)
    false
     */
    public boolean is_prime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2 || n == 3) {
            return true;
        }
        if (n % 2 == 0 || n % 3 == 0) {
            return false;
        }
        int i = 5;
        while (i * i <= n) {
            if (n % i == 0 || n % (i + 2) == 0) {
                return false;
            }
            i += 6;
        }
        return true;
    }
}

