class Solution {
    private HashMap<Integer, Integer> memo = new HashMap<>();

    public List<Integer> tri(int n) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            result.add(tribonacci(i));
        }
        return result;
    }

    private int tribonacci(int num) {
        if (memo.containsKey(num)) {
            return memo.get(num);
        }
        if (num == 1) {
            memo.put(num, 3);
            return 3;
        } else if (num % 2 == 0) {
            int value = 1 + num / 2;
            memo.put(num, value);
            return value;
        } else {
            int value = tribonacci(num - 1) + tribonacci(num - 2) + tribonacci(num + 1);
            memo.put(num, value);
            return value;
        }
    }
}

