     */
    public boolean has_close_elements(List<Double> numbers, double threshold) {
        // Sort the list of numbers
        Collections.sort(numbers);

        // Iterate through the sorted list to check the differences between consecutive elements
        for (int i = 0; i < numbers.size() - 1; i++) {
            double diff = Math.abs(numbers.get(i + 1) - numbers.get(i));
            if (diff < threshold) {
                return true;
            }
        }

        // If no such pair is found, return false
        return false;
    }
}

