class Solution {
    /**
    Insert a number 'delimiter' between every two consecutive elements of input list `numbers'
    >>> intersperse(List.of(), 4)
    []
    >>> intersperse(Arrays.asList(1, 2, 3), 4)
    [1, 4, 2, 4, 3]
     */
    public List<Integer> intersperse(List<Integer> numbers, int delimiter) {
        // Check if the list is empty
        if (numbers.isEmpty()) {
            return new ArrayList<>();
        }

        // Initialize the result list
        List<Integer> result = new ArrayList<>();

        // Iterate through the numbers
        for (int i = 0; i < numbers.size(); i++) {
            // Add the current number to the result list
            result.add(numbers.get(i));

            // If the current index is not the last index, add the delimiter
            if (i < numbers.size() - 1) {
                result.add(delimiter);
            }
        }

        // Return the result list
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.intersperse(List.of(), 4)); // []
        System.out.println(solution.intersperse(Arrays.asList(1, 2, 3), 4)); // [1, 4, 2, 4, 3]
