class Solution {
    /**
    Given an array of integers, sort the integers that are between 1 and 9 inclusive,
    reverse the resulting array, and then replace each digit by its corresponding name from
    "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine".
     */
    public List<String> by_length(List<Integer> arr) {
        // Define the mapping from digits to their names
        Map<Integer, String> digitNames = new HashMap<>();
        digitNames.put(1, "One");
        digitNames.put(2, "Two");
        digitNames.put(3, "Three");
        digitNames.put(4, "Four");
        digitNames.put(5, "Five");
        digitNames.put(6, "Six");
        digitNames.put(7, "Seven");
        digitNames.put(8, "Eight");
        digitNames.put(9, "Nine");

        // Filter out numbers that are not between 1 and 9
        List<Integer> filteredArr = new ArrayList<>();
        for (Integer num : arr) {
            if (1 <= num && num <= 9) {
                filteredArr.add(num);
            }
        }

        // Sort the filtered array
        Collections.sort(filteredArr);

        // Reverse the sorted array
        Collections.reverse(filteredArr);

        // Replace each digit with its corresponding name
        List<String> result = new ArrayList<>();
        for (Integer num : filteredArr) {
            result.add(digitNames.get(num));
        }

        return result;
    }
}

