class Solution {
    /**
    In this task, you will be given a string that represents a number of apples and oranges
    that are distributed in a basket of fruit this basket contains
    apples, oranges, and mango fruits. Given the string that represents the total number of
    the oranges and apples and an integer that represent the total number of the fruits
    in the basket return the number of the mango fruits in the basket.
    for example:
    fruit_distribution("5 apples and 6 oranges", 19) -> 19 - 5 - 6 = 8
    fruit_distribution("0 apples and 1 oranges", 3) -> 3 - 0 - 1 = 2
    fruit_distribution("2 apples and 3 oranges", 100) -> 100 - 2 - 3 = 95
    fruit_distribution("100 apples and 1 oranges", 120) -> 120 - 100 - 1 = 19
     */
    public int fruit_distribution(String s, int n) {
        // Regular expression to match the number of apples and oranges
        String regex = "(\\d+) apples and (\\d+) oranges";
        Pattern pattern = Pattern.compile(regex);
        Matcher matcher = pattern.matcher(s);

        if (matcher.find()) {
            // Extract the number of apples and oranges
            int apples = Integer.parseInt(matcher.group(1));
            int oranges = Integer.parseInt(matcher.group(2));

            // Calculate the number of mangoes
            int mangoes = n - (apples + oranges);
            return mangoes;
        } else {
            throw new IllegalArgumentException("Input string does not match the expected format.");
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.fruit_distribution("5 apples and 6 oranges", 19)); // Output: 8
        System.out.println(solution.fruit_distribution("0 apples and 1 oranges", 3));  // Output: 2
        System.out.println(solution.fruit_distribution("2 apples and 3 oranges", 100)); // Output: 95
        System.out.println(solution.fruit_distribution("100 apples and 1 oranges", 120)); // Output: 19
    }
}

