class Solution {
    /**
    Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    separate those group into separate strings and return the list of those.
    Separate groups are balanced (each open brace is properly closed) and not nested within each other
    Ignore any spaces in the input string.
    >>> separate_paren_groups("( ) (( )) (( )( ))")
    ["()", "(())", "(()())"]
     */
    public List<String> separate_paren_groups(String paren_string) {
        // Remove spaces from the input string
        String cleanedString = paren_string.replaceAll(" ", "");

        // Initialize variables
        List<String> groups = new ArrayList<>();
        Deque<Character> stack = new ArrayDeque<>();
        StringBuilder currentGroup = new StringBuilder();

        // Iterate through each character in the cleaned string
        for (char ch : cleanedString.toCharArray()) {
            if (ch == '(') {
                // Add the opening parenthesis to the stack and current group
                stack.push(ch);
                currentGroup.append(ch);
            } else if (ch == ')') {
                // Pop the top element from the stack and add the closing parenthesis to the current group
                stack.pop();
                currentGroup.append(ch);

                // If the stack is empty, the current group is balanced and complete
                if (stack.isEmpty()) {
                    groups.add(currentGroup.toString());
                    currentGroup.setLength(0); // Reset the current group
                }
            }
        }

        return groups;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<String> result = solution.separate_paren_groups("( ) (( )) (( )( ))");
        System.out.println(result); // Expected output: ["()", "(())", "(()())"]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

